Concurrency management
How to configure concurrency
Basic concurrency
The most basic concurrency limit is a single
```
limit
```
set to an integer value of the maximum number of concurrently executing steps. When concurrency limit is reached, new steps will continue to be queued and create a backlog to be processed.
TypeScript Go Python
Copy Copied
```
inngest .createFunction (
{
id : "generate-ai-summary" ,
concurrency : 10 ,
} ,
{ event : "ai/summary.requested" } ,
async ({ event , step }) => {
// Your function handler here
}
);
```

Concurrency management
How to configure concurrency
Combining multiple concurrency limits
Each SDK's concurrency option supports up to two limits. This is the most beneficial when combining limits, each with a different
```
scope
```
. Here is an example that combines two limits, one on the
```
"account"
```
scope and another on the
```
"fn"
```
level. Combining limits will create multiple virtual queues to limit concurrency. In the below function:
- If there are 10 steps executing under the 'openai' key's virtual queue, any future runs will be blocked and will wait for existing runs to finish before executing.
- If there are 5 steps executing under the 'openai' key and a single `event.data.account_id` enqueues 2 runs, the second run is limited by the `event.data.account_id` virtual queue and will wait before executing.
TypeScript Go Python
Copy Copied
```
inngest .createFunction (
{
id : "unique-function-id" ,
concurrency : [
{
// Use an account-level concurrency limit for this function, using the
// "openai" key as a virtual queue.  Any other function which
// runs using the same "openai"` key counts towards this limit.
scope : "account" ,
key : `"openai"` ,
limit : 10 ,
} ,
{
// Create another virtual concurrency queue for this function only.  This
// limits all accounts to a single execution for this function, based off
// of the `event.data.account_id` field.
// NOTE - "fn" is the default scope, so we could omit this field.
scope : "fn" ,
key : "event.data.account_id" ,
limit : 1 ,
} ,
] ,
} ,
{ event : "ai/summary.requested" } ,
async ({ event , step }) => {
}
);
```
It's worth it to note that the
```
"fn"
```
scope is the default and is optional to include.

Concurrency management
How global limits work
While two functions can share different
```
account
```
scoped limits, we strongly recommend that you use a global const with a single shared limit.
You may write two functions that define different levels for an 'account' scoped concurrency limit.  For example, function A may limit the "ai" capacity to 5, while function B limits the "ai" capacity to 50:
TypeScript Go Python
Copy Copied
```
inngest .createFunction (
{
id : "func-a" ,
concurrency : {
scope : "account" ,
key : `"openai"` ,
limit : 5 ,
} ,
} ,
{ event : "ai/summary.requested" } ,
async ({ event , step }) => {
}
);

inngest .createFunction (
{
id : "func-b" ,
concurrency : {
scope : "account" ,
key : `"openai"` ,
limit : 50 ,
} ,
} ,
{ event : "ai/summary.requested" } ,
async ({ event , step }) => {
}
);
```
This works in Inngest and is
*not*
a conflict.  Instead, function A is limited any time there are 5 or more functions running in the 'openai' queue.  Function B, however, is limited when there are 50 or more items in the queue.  This means that function B has more capacity than function A, though both are limited and compete on the same virtual queue.
Because functions are FIFO, function runs are more likely to be worked on the older their jobs get (as the backlog grows).  If function A's jobs stay in the backlog longer than function B's jobs, it's likely that their jobs will be worked on as soon as capacity is free.  That said, function B will almost always have capacity before function A and may block function A's work.
**While this works we strongly recommend that you use global constants for**
**```
env
```**
**or**
**```
account
```**
**level scopes, giving functions the same limit.**

Concurrency management
Further examples
Restricting parallel import jobs for a customer id
In this hypothetical system, customers can upload
```
.csv
```
files which each need to be processed and imported. We want to limit each customer to only one import job at a time so no two jobs are writing to a customer's data at a given time. We do this by setting a
```
limit: 1
```
and a concurrency
```
key
```
to the
```
customerId
```
which is included in every single event payload.
Inngest ensures that the concurrency (
```
1
```
) applies to each unique value for
```
event.data.customerId
```
. This allows different customers to have functions running at the same exact time, but no given customer can have two functions running at once!
TypeScript Go Python
Copy Copied
```
export const send = inngest .createFunction (
{
name : "Process customer csv import" ,
id : "process-customer-csv-import" ,
concurrency : {
limit : 1 ,
key : `event.data.customerId` , // You can use any piece of data from the event payload
} ,
} ,
{ event : "csv/file.uploaded" } ,
async ({ event , step }) => {
await step .run ( "process-file" , async () => {
const file = await bucket .fetch ( event . data .fileURI);
// ...
});

return { message : "success" };
}
);
```
